import React, { Component } from 'react';
import { NavLink, withRouter } from 'react-router-dom';

class FlightInfo extends Component {
  render() {
    return (
      <div className='ui form'>
        Flight Info Form
      </div>
    )
  }
}

export default withRouter(FlightInfo);
